import React, { useState, useEffect } from 'react';
import axios from 'axios';

function YourComponent() {
  const [sheetData, setSheetData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('https://script.google.com/macros/s/AKfycbxfEph-j-5ELfvRhnZchIVuxTo1ZvdrhxucKOhviDM0tqrV9preBWXL-03tiaAsSHgAwQ/exec');
        setSheetData(response.data);
      } catch (error) {
        console.error('Error fetching Google Sheets data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1>Data from Google Sheets</h1>
      <table>
        <thead>
          <tr>
            <th>Fullname</th>
            <th>Student ID</th>
            <th>Level</th>
            <th>Subject</th>
            <th>About</th>
          </tr>
        </thead>
        <tbody>
          {sheetData.map((row, index) => (
            <tr key={index}>
              <td>{row.fullname}</td>
              <td>{row.stdid}</td>
              <td>{row.level}</td>
              <td>{row.subj}</td>
              <td>{row.about}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default YourComponent;
